		/// יצירת טיימר למשחק
		function Time() {
			myTime = new createjs.Text();
			if (timeCheng == 1) {
				timer = newTime;
				timeCheng--;
			} else {
				timer = newTimeJadon;
			}
			game.addChild(myTime);
			myTime.text = "00:" + timer;
			myTime.x = 125;
			myTime.y = 15;
			myTime.font = "20px Rubik";
		
			myTimer = setInterval(checkTime, 1000);
		
			// פונקציה ליצירת טיימר
			function checkTime() {
				myTime.text = "00:" + timer;
				// מה קורה במצב שנגמר הזמן
				if (timer == 0) {
					timeup = new lib.timeUp();
					stage.addChild(timeup);
					timeup.x = 400;
					timeup.y = 200;
					clean();
					theSighns.visible = false;
					stage.getChildByName("myTurtle").visible = false;
		
					if (newTimeJadon != 0) {
						clearInterval(myTimer);
					}
		
					for (i = 1; i < answers[Qrandom].length; i++) {
						answers[Qrandom][i][2] = "0";
					}
					timeup.timeUpBTN.addEventListener("click", nextQwestion);
					answers[Qrandom][0][1]++; // מספר הפעמים שהשאלה מופיע במשחק
					myMistaks++;
					QTime = 60 - timer; // כמה זמן לקח לשחקן לענות על השאלה
				}
				timer--;
			}
		}
		
