		function SoundON() {
			SoundCounter++;
		
			IFSound();
		
		}
		
		//פונקציה שבודקת באיזה מצב הכפתור סאונד - עם סאונד או בלי
		function IFSound() {
		
			if (SoundCounter == 1) {
				instance = createjs.Sound.play("GameSound");
				SoundB.gotoAndStop(1);
		
			}
			if (SoundCounter == 2) {
				SoundCounter = 0;
				instance = createjs.Sound.stop("GameSound");
				instance = createjs.Sound.stop("SuccessSound");
				instance = createjs.Sound.stop("failSound");
				instance = createjs.Sound.stop("PauseSound");
				SoundB.gotoAndStop(0);;
			}
		
		
		}
		
		
